import React, { useState, useEffect } from "react";
import logo from '../logo.svg';

function Login() {
  
  return (
    <div className="Login">
      <header className="App-header">
      <img src={logo} className="App-logo" alt="logo" />
        <p>
          <code>Login</code>
        </p>
      </header>
    </div>
  );
}

export default Login;
